import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';



import Navbaro from '../src/app'
import india from '../src/components/indiatable'




class App extends React.Component {


render(){


  return(
    <div>
       <Navbaro />
       <india />

    </div>

    )}


}


ReactDOM.render(
  <App />,

  document.getElementById('root')
);


